import React, {Component} from 'react';
import {Drawer, Menu} from "antd";

class ToggleManagerView extends Component {

    render() {
        return (
            <Drawer visible={this.props.visible} placement='right' maskClosable={true} onClose={this.props.close}
                    bodyStyle={{padding:'0'}}>
                <Menu theme='dark' style={{height:innerHeight}}>
                    <Menu.Item>数据视图</Menu.Item>
                    <Menu.Item>工作台</Menu.Item>
                </Menu>
            </Drawer>
        );
    }
}

export default ToggleManagerView;
